const API_SERVER = "http://localhost:8000";

const LINKS = {
    driver: [{
      name: "Podróż",
      link: "/trip"
    }, {
      name: "Kursy",
      link: "/courses"
    }],
    accountant: [{
      name: "Raporty",
      link: "/reports"
    }, {
      name: "Zarobki",
      link: "/salaries"
    }],
    ceo: [{
      name: "Pracownicy",
      link: "/employees"
    }, {
      name: "Pojazdy",
      link: "/vehicles"
    }],
    mechanic: [{
      name: "Pojazdy",
      link: "/vehicles"
    }, {
      name: "Naprawy",
      link: "/repairs"
    }],
    transportCoord: [{
      name: "Kursy",
      link: "/course"
    }]
  }
  const BLANK_VEHICLE =
  {
      _id: "",
      model: "",
      brand: "",
      capacity: 0,
      repair: [],
      year_production: 0,
      registration_number: "",
      engine_number: "",
      engine_capacity: 0,
      type: "",
      available: false
  }
const BLANK_REPAIR = {
  _id: "",
  description: null,
  start_repair: "",
  end_repair: null,
  status: true,
  number: 0
}

export {API_SERVER, LINKS, BLANK_VEHICLE, BLANK_REPAIR};
